import * as React from 'react';
import { AppBar, Toolbar, Typography, Button, Menu, MenuItem } from '@mui/material';
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';

const DashboardNavBar = () => {
    return (
        <AppBar position="static" color="primary">
            <Toolbar>
                <PopupState variant="popover" popupId="clientes-popup-menu">
                    {(popupState) => (
                        <React.Fragment>
                            <Button variant="contained" {...bindTrigger(popupState)}>
                                Clientes
                            </Button>
                            <Menu {...bindMenu(popupState)}>
                                <MenuItem onClick={popupState.close}>Agregar Cliente</MenuItem>
                            </Menu>
                        </React.Fragment>
                    )}
                </PopupState>
                <PopupState variant="popover" popupId="servicios-popup-menu">
                    {(popupState) => (
                        <React.Fragment>
                            <Button variant="contained" {...bindTrigger(popupState)}>
                                Servicios
                            </Button>
                            <Menu {...bindMenu(popupState)}>
                                <MenuItem onClick={popupState.close}>Agregar Servicio</MenuItem>
                            </Menu>
                        </React.Fragment>
                    )}
                </PopupState>
                <PopupState variant="popover" popupId="profesionales-popup-menu">
                    {(popupState) => (
                        <React.Fragment>
                            <Button variant="contained" {...bindTrigger(popupState)}>
                                Profesionales
                            </Button>
                            <Menu {...bindMenu(popupState)}>
                                <MenuItem onClick={popupState.close}>Agregar Profesional</MenuItem>
                            </Menu>
                        </React.Fragment>
                    )}
                </PopupState>
            </Toolbar>
        </AppBar>
    );
}

export default DashboardNavBar;
